import {CACHEUSER} from '../user_const'

const undefinedUser = {};

export default function countReducer(prevState=undefinedUser,action){
    const {type,data} = action;
    switch (type) {
        case "cacheUser":
            return data;
        default:
            return prevState;
    }
}
